import React from 'react';
import { Grid } from '@material-ui/core';

import Product from './Product/Product'
import Images from './components/Images'

const products = [
    { id: 1, name: 'Wreath#1', description: 'Fall wreath.', price: '$50', image: 'Half-a-Moon-Wreath.jpg' },
    { id: 2, name: 'Wreath#2', description: 'Winter wreath.', price: '$75', image: './Images/Bow-Angel-Wreath.jpg'},
    { id: 3, name: 'Wreath#3', description: 'Winter wreath.', price: '$100', image: './Images/The-N-Wreath.jpg'},

];

const Products = () => {
    return (
        <main>
            <Grid container justify="center" spacing={4}>
                {products.map((product) => (
                    <Grid item key={product.id} xs={12} sm={6} md={4} lg={3}>
                        <Product product={product} />
                    </Grid>
                ))}
            </Grid>
        </main>
    );
}

export default Products;
